import React, { useState, useEffect } from 'react'

const ScheduleBooking = () => {
    const [monthData, setMonthData] = useState([]);
    const [displayedData, setDisplayedData] = useState([]);
    const [startIndex, setStartIndex] = useState(0);

    useEffect(() => {
        // Get the current date
        const currentDate = new Date();

        // Calculate the date of 1 month later
        const oneMonthLaterDate = new Date(currentDate);

        oneMonthLaterDate.setMonth(oneMonthLaterDate.getMonth() + 1);

        const data = [];
        let currentDateIterator = new Date(currentDate);

        while (currentDateIterator <= oneMonthLaterDate) {
            data.push({
                date: new Date(currentDateIterator),
            });
            currentDateIterator.setDate(currentDateIterator.getDate() + 1);
        }
        setMonthData(data);
        setDisplayedData(data.slice(startIndex, startIndex + 3));
    }, [startIndex]);


    const handleNextClick = () => {
        if (startIndex + 3 < monthData.length) {
            setStartIndex(startIndex + 3);


        }
    };
    const handlePreviewClick = () => {
        if (startIndex - 3 >= 0) {
            setStartIndex(startIndex - 3);
        }
    };

    return (
        <>
            <div className='d-flex justify-content-center flex-column  mt-5 m-3'>
                <div className='d-flex mx-auto '>
                    <h1>Appointment Booking</h1>
                </div>
                <div className='d-flex border mx-auto border-secondary m-2 justify-content-between p-2 align-items-center gap-2 ' style={{ width: '70vw' }}>
                    <button style={{ width: '6vw', height: '5vh' }} className='btn btn-outline-dark' onClick={handlePreviewClick} disabled={startIndex === 0}> Preview </button>
                    {displayedData.map((item, index) => (
                        <li key={index} className='d-flex border border-primary p-2 m-2 gap-5'>
                            {item.date.toLocaleDateString()}
                        </li>
                    ))}
                    <button style={{ width: '6vw', height: '5vh' }} className='btn btn-outline-dark' onClick={handleNextClick} disabled={startIndex + 3 >= monthData.length}>Next</button>
                </div>
            </div>

            <div className='d-flex justify-content-center flex-column align-items-centerm'>
                <div className='d-flex border mx-auto border-secondary  flex-wrap justify-content-evenly m-2 flex-wrap p-2 align-items-center gap-2' style={{ width: '70vw' }}>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>10:00AM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>10:30AM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>11:00AM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>11:30AM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>12:00PM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>12:30PM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>01:00PM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>01:30PM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>02:00PM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>02:30PM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>03:00PM</button>
                    <button className='btn btn-outline-primary' style={{ width: '15vw' }}>03:30PM</button>
                    <button className='btn btn-outline-primary align-self-start' style={{ width: '15vw' }}>04:00PM</button>
                    <button className='btn btn-outline-primary self-align-start' style={{ width: '15vw' }}>04:30PM</button>
                </div>
            </div>
        </>
    )
}

export default ScheduleBooking
